"use strict";$(function(){var injections={fillClaim:{urlTest:function(){return/\/insurance_claims\/\d*\/edit/i.test(window.location.href)},inject:function(){$.getScript("https://cdn.jsdelivr.net/gh/m4ttheweric/fill-claim@latest/dist/fill-claim.min.js")}},autoEdit:{urlTest:function(){return/\/insurance_claims\/\d+\?editMe=y/i.test(window.location.href)},inject:function(){location.href=document.URL.replace("?editMe=y","/edit?autoMagicFill=y")}},openClaimsInTabs:{urlTest:function(){return/\/billings\/insurance#claims/i.test(window.location.href)},inject:function(){var btn;btn=$('<a class="primary button" href="javascript:void(0)" style="float: right;margin-bottom: 18px;background-color: #8a2be2;">Magic Fill All Prepared Claims!</a>').on("click",function(){$("table.insurance-claims-list tr").filter(function(){return 0<$(this).find('span.badge:contains("Prepared")').length}).each(function(){window.open($(this).data("url")+"?editMe=y","_blank")})}),$("#claims").prepend(btn)}}};Object.entries(injections).forEach(function(injection){injection[0];injection=injection[1];injection.urlTest()&&injection.inject()})});